import classes from './Layout.module.css';
import {Fragment} from "react";

const MainNavigation = (props) => {

    return (
        <Fragment className={classes.header}>
           <MainNavigation/>
            <main className={classes.main}>
                {props.children}
            </main>
        </Fragment>
    );
}

export default MainNavigation;
